class map:
    def __init__(self, data):
        self.data = data
        self.rect_list = []
        self.base_path_list = []
        self.path_list = []
        self.size = 5
        self.path_count = 0
        self.found = False
        self.path_num_to_find = 1
        self.order = 0
        for r in range(len(self.data)):
            for c in range(len(self.data[r])):
                if self.data[r][c] != 0:
                    rect = py.Rect((c*self.size, r*self.size), (self.size, self.size))
                    self.rect_list.append(rect)
                    if self.data[r][c] != 1:
                        self.path_count += 1
        for i in range(self.path_count):
            self.found = False
            for r in range(len(self.data)):
                if not self.found:
                    for c in range(len(self.data[r])):
                        if not self.found:
                            if self.data[r][c] != 0 and self.data[r][c] != 1:
                                if self.data[r][c][1] == self.path_num_to_find:
                                    self.base_path_list.append(self.data[r][c][2])
                                    self.found = True
                                    self.path_num_to_find += 1
        for i in range(len(self.base_path_list)):
            if i != len(self.base_path_list)-1:
                first = (self.order, self.base_path_list[i])
                self.order += 1
                other = self.base_path_list[i+1]
                last = (self.order, ((first[1][0]+other[0])/2, (first[1][1]+other[1])/2))
                self.order += 1
                self.path_list.append(first)
                self.path_list.append(last)
class floating_text:
    red = (255, 0, 0)
    def __init__(self, screen, text, font="arial", color=red, size=int(width/10)):
        self.screen = screen
        self.font = py.font.SysFont(font, size)
        self.color = color
        self.text = self.font.render(text, 1, self.color)
        self.rect = self.text.get_rect()
        self.rect.center = ((width//2), (height//3))
        self.alpha = 255
    def draw(self):
        self.text.set_alpha(self.alpha)
        self.alpha -= 2
        self.rect.y -= 1
        self.screen.blit(self.text, self.rect)
class base_enemy:
    def __init__(self, screen, imgae_list, map, width=width//25*1.4, height=height//15*1.4, colorkey=None, speed=1):
        self.screen = screen
        self.map = map
        self.image_list = []
        self.width = width
        self.height = height
        for image in imgae_list:
            image = py.image.load(image)
            image = py.transform.scale(image, (self.width, self.height))
            if colorkey != None:
                image.set_colorkey(colorkey)
            image_rect = image.get_rect()
            self.image_list.append((image, image_rect))
        self.index = 0
        self.movement_counter = 0
        self.pos_on = 0
        self.speed = speed
    def draw(self):
        self.image_list[self.index][1].center = self.map.path_list[self.pos_on][1]
        if self.movement_counter % self.speed == 0:
            self.movement_counter = 0
            if not self.pos_on == len(self.map.path_list):
                if not self.pos_on + 1 >= len(self.map.path_list):
                    self.pos_on += 1
        self.movement_counter += 1
        self.screen.blit(self.image_list[self.index][0], self.image_list[self.index][1])
