def draw_loading_screen():
    white = (255, 255, 255)
    black = (0, 0, 0)
    screen.fill(white)
    font = py.font.SysFont("arial", width//5)
    text = font.render("Loading...", 1, black)
    text_rect = text.get_rect()
    text_rect.center = (width//2, height//2)
    screen.blit(text, text_rect)
    py.display.update()
def draw_start_screen(start_text_1, start_text_1_cords, start_text_2, start_text_2_cords, start_button, floating_texts):
    screen.fill(white)
    screen.blit(start_text_1, start_text_1_cords)
    screen.blit(start_text_2, start_text_2_cords)
    start_button.draw()
    for text in floating_texts:
        text.draw()
    py.display.update()
def draw_map_select_screen(level_select_bg, pages, page_on, map_select_text, map_select_text_cords, right_arrow, left_arrow, floating_texts):
    screen.blit(level_select_bg, (0, 0))
    screen.blit(map_select_text, map_select_text_cords)
    pages[page_on-1].draw()
    if len(pages) > page_on:
        right_arrow.draw()
    if page_on > 1:
        left_arrow.draw()
    for text in floating_texts:
        text.draw()
    py.display.update()
def draw_map_screen(map_img, map_rect, menu_ig, charictars_on_screen, floating_texts, enemys, settings_wheel):
    screen.blit(map_img, map_rect)
    menu_ig.draw()
    settings_wheel.draw()
    for enemy in enemys:
        enemy.draw()
    for charictar in charictars_on_screen:
        charictar.draw()
    for text in floating_texts:
        text.draw()
    py.display.update()
def page_on_add():
    global page_on
    page_on += 1
def page_on_subtract():
    global page_on
    page_on -= 1
def play_pause():
    global game_running, menu_ig
    if menu_ig.clicks_of_play_button < 2:
        menu_ig.game_running = True
        game_running = True
        menu_ig.clicks_of_play_button += 1
    else:
        game_running = not game_running
        menu_ig.game_running = game_running
